import { IonApp } from "@ionic/react";
import Header from "./Components/Header/Header";
import { Test } from "./Components/Test/Test";
import Login from "./Login/Login";

function App() {
  return (
   <IonApp >
        <Header />
        <Login />
        <Test />
   </IonApp>
  );
}

export default App;
